update  vcodes v 
set vcode = 'arra-2024-10-29-1' || substring(vcode, 18)
where vcode_id >= 101774
and to_char(fecha, 'yyyy-mm-dd') <> substring (vcode, 6, 10)

update  vdetalle  
set vcode1 = 'arra-2024-10-29-1' || substring(vcode1, 18)
where ref_id_vcode  >= 101774
and to_char(fecha1, 'yyyy-mm-dd') <> substring (vcode1, 6, 10)


ALTER TABLE public.vcodes DROP CONSTRAINT vcode_pr;
ALTER TABLE public.vcodes DROP CONSTRAINT "vcode.uniq";

ALTER TABLE public.vdetalle DROP CONSTRAINT "vdetalle1.pr";
ALTER TABLE public.vdetalle ADD CONSTRAINT vdetalle_pk PRIMARY KEY (id_vdetalle);
ALTER TABLE public.vdetalle ADD CONSTRAINT vdetalle_unique UNIQUE (vcode1,codigo1,precio,fecha1);

